CREATE TABLE airports(
   airport_id        INTEGER  NOT NULL PRIMARY KEY 
  ,ident             VARCHAR(7) NOT NULL
  ,type              VARCHAR(14) NOT NULL
  ,name              VARCHAR(60) NOT NULL
  ,latitude_deg      NUMERIC(11,8) NOT NULL
  ,longitude_deg     NUMERIC(12,8) NOT NULL
  ,elevation_ft      INTEGER 
  ,continent         VARCHAR(2) NOT NULL
  ,iso_country       VARCHAR(2) NOT NULL
  ,iso_region        VARCHAR(6) NOT NULL
  ,municipality      VARCHAR(34)
  ,scheduled_service VARCHAR(3) NOT NULL
  ,gps_code          VARCHAR(4)
  ,iata_code         VARCHAR(3)
  ,local_code        VARCHAR(4)
);
